import React from 'react';
import { SLoadMoreBtn, SLoadMoreBtnContainer } 
from '../styles/SLoadMoreBtn';
import { Link } from '@reach/router';

const NotFound = ({ text}) => (
    <>
<h1> No movie found, try again!</h1>
 <SLoadMoreBtnContainer>
 <Link to="/">
 <SLoadMoreBtn type="button">Return to homepage</SLoadMoreBtn>
 </Link>
 </SLoadMoreBtnContainer>
 </>
)

export default NotFound;
